import React from "react";
import { Link } from "react-router-dom";
import "../styles/navbar.css";
import logo from "../assets/cblu_logo.png";

const Navbar = () => (
  <nav className="navbar">
    <div className="navbar-logo">
      <Link to="/">
        <img
          src={logo}
          alt="Logo"
          style={{ height: "72px", width: "65px", marginRight: "10px", borderRadius: "50%" }}
        />
        <span style={{ fontFamily: "'Segoe Script', cursive", fontWeight: "bold", fontSize: "28px", color: "#ffd700", letterSpacing: "2px" }}>
          Hostel App
        </span>
      </Link>
    </div>
    <ul className="navbar-links">
      <li>
        <Link to="/">Home</Link>
      </li>
      <li>
        <Link to="/list-pg">Add PG</Link>
      </li>
      <li>
        <Link to="/contact">Contact</Link>
      </li>
    </ul>
  </nav>
);

export default Navbar;
